import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button } from 'reactstrap';

const useStyles = makeStyles((theme) => ({

	table : {
		width : '90%',
	},

	window : {

		paddingLeft : '10%',
		paddingRight : '1%',
		marginTop : '1%'
	},
	image : {
		height : '50px',
  		width : '50px'
	},
	description : {
		paddingBottom : '10px'
	}

})
);
function Cart(){
	const classes = useStyles();
	return(
		<>
			<div className={classes.window}>
			<Button style={{background : '#B0DFE5'}}>
				continue Shopping
			</Button>
			<table className={classes.table}>
			  <tbody>
			    <tr>
			      <th>Item</th>
			      <th>Price</th>
			      <th>Quantity</th>
			      <th>Subtotal</th>
			    </tr>

			    <tr>
			      <td>
			      	<img className={classes.image} src="http://lghttp.18445.nexcesscdn.net/808F9E/mage/media/catalog/product/cache/2/thumbnail/550x/9df78eab33525d08d6e5fb8d27136e95/v/5/v508_hammer.jpg" />
			      	<br/>
			      	<p className={classes.description}>
			      		16 in. Groove Joint Pliers SKU#1234
			      	</p>
			      </td>
			      <td id="price">
			      	$24.99
			      </td>
			      <td>
				      <div className="counter">
				  		<input id="qty" value="0" style={{width : '10px', borderBottom : '0px solid', height : '15px', paddingLeft : '27px'}}/>
				  		<br/>
				  		<Button className="dec" onclick="modify_qty(-1)" style={{ width : '15%', height : '1%'}}>-</Button>
				  		<Button className="inc" onclick="modify_qty(+1)" style={{ width : '15%', height : '1%'}}>+</Button>
					  </div>
				  </td>
			      <td id="subtotal">
			      	$24.99
			      </td>
			    </tr>



			  </tbody>
			</table>
			</div>
		</>

		);
}

export default Cart
